try {
  const authResponse = await fetch('https://api.dellin.ru/v3/auth/login.json', {
    method: 'POST',
    headers: {
      'Content-Type': 'application/json'
    },
    body: JSON.stringify({
      appkey: 'E6C50E91-8E93-440F-9CC6-DEF9F0D68F1B'  // Используем стандартный ключ
    })
  });

  const authData = await authResponse.json();
  console.log('Деловые Линии авторизация:', authData);

  if (authResponse.ok && authData.data?.sessionID) {
    return authData.data.sessionID;
  } else {
    console.error('Ошибка авторизации Деловые Линии:', authData);
    return null;
  }
